  var sd = new Date(longestStreakObj.startDate);
  var sdYear = sd.getFullYear(); // note that january is 0! so add 1

  var sdMonth = sd.getMonth() + 1;
  var sdDay = sd.getDate();
  var sdStr = sd.toDateString();
  var ed = new Date(longestStreakObj.endDate);
  var edYear = ed.getFullYear(); // note that january is 0! so add 1

